import { Component, Vue, Prop } from 'vue-property-decorator';
import { State, Action } from 'vuex-class';

@Component
export default class ConditionVideo extends Vue {
  @Prop({default: false}) private searchByVideo!: boolean;
  @Prop({default: {}}) private openVideoPopup!: any;
  @Prop({default: {}}) private closeVideoPopup!: any;
  @Prop({default: {}}) private changeHasVideo!: any;
  @Prop({default: {}}) private requestCallback!: any;
  @Prop({default: 0}) private hasVideo!: number;
  private toggleVideoPopup(): void {
    if (this.searchByVideo) {
      this.closeVideoPopup();
    } else {
      this.openVideoPopup();
    }
  }
  private handleClick(i: number): void {
    this.changeHasVideo(i);
    this.requestCallback();
  }
}
